import React, { useEffect, useState } from 'react';


import axios from 'axios';

function AlienList() {

    console.log("alinList")

  const [aliens, setAliens] = useState([]);

  useEffect(() => {

    const fetchAliens = async () => {

      try {
        const response = await axios.get(`http://localhost:6000/aliens`);
        console.log(response)

        setAliens(response.data);

      } catch (error) {

        console.error('Error fetching aliens:', error);

      }
    };

    fetchAliens();

  }, []);

  return (

    <div>
      <h2>Aliens</h2>
      <ul>
        {aliens.map((alien) => (

          <li key={alien._id}>{alien.name}</li>


        ))}
      </ul>
    </div>
  );
}

export default AlienList;
